import React from "react";
import "./popularRestaurants.css";
import RestaurantCard from "./reataurantCard/RestaurantCard";
import IRestaurantCard from "../../../../types/interfaces/IRestaurantCard";


const PopularRestaurants: React.FC = () => {
    const restaurantsToRender:IRestaurantCard = {img:'/Assets/restaurants-images/claro.svg', name:'Tiger', chef:'Meir', rating:5};
      return (
          <div id="popular-restaurants">
              <h2>popular restaurant in epicure:</h2>
              <div>
                <RestaurantCard img={restaurantsToRender.img} name={restaurantsToRender.name} chef={restaurantsToRender.chef} rating={restaurantsToRender.rating}/>
              </div>
          </div>
      );
    }

export default PopularRestaurants;
